import ExpenseItem from './ExpenseItem';


export default function Expenses({ expenses }) {
	return expenses.map(expense => (
		<div className='expenses'>
			<ExpenseItem
				key={expense.id}
				id={expense.id}
				title={expense.title}
				amount={expense.amount}
				date={expense.date}
			/>
		</div>
	));
}
